import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Navbar from "./Navbar";
import Button from '@material-ui/core/Button';


export default function Home() {

  return (
    <div>
        <Navbar/>
        <div>
            Home!
        </div>
        <Button
            color="primary"
        > Click Me!
        </Button>
    </div>
  );
}
